                ik wilde afstuderen. Ik he");
                WriteLiteral(@"b toen gekozen om me te specialiseren in het behandelen van ADD.
            </p>
            <h3><b>Wat is ADD en heb ik het? </b></h3>
            <p>
                ADD staat voor Alle Dagen Druk, ook wel in het Engels bekend als Attention Deficit Disorder. ADD wordt
                vaak vergeleken en gezien als ADHD, maar ADHD staat voor Alle Dagen Heel Druk of in het Engels Attention
                Deficit Hyperactivity Disorder. In ADD ontbreekt dus het Hele of Hyperactivity aspect.

                Je kan ADD onder andere herkennen aan onderstaande kenmerken:
                </p>
            <ul>
                <li>Problemen met focussen</li>
                <li>Constante drukte in je hoofd</li>
                <li>Snel afgeleid zijn</li>
                <li>Problemen met het stellen van prioriteiten</li>
                <li>Het uiten van je gevoelens</li>
            </ul>
            <p>
            Wanneer je bovenstaande kenmerken herkent, zou het kunnen zijn dat je ADD hebt. H");
                WriteLiteral(@"et vaststellen van ADD moet
            door specialisten worden gedaan. De diagnose kan niet zelf worden vastgesteld.
            </p>
            
            <h3><b>Hoe ziet het behandelproces eruit?</b></h3>
            <p>
