                ouders, zo kan ik ook een beter beeld krijgen vanuit een ander perspectief. In de kennismaking vertel je
                waar je last van hebt. Indien ADD bij jou wordt geconstateerd, bespreken we hoe we het ADD gaan
                behandelen.

